import GoogleMapReact from 'google-map-react'
import React from 'react'

import './map.scss'
import OverlayMkad from "../Overlay/Overlay";


const Map = ({center, zoom}) => {
    return (
        <div className='map'>
            <GoogleMapReact
                bootstrapURLKeys={{key: 'AIzaSyBYEey3dAT7X6YcANl4oNHBa5V-4KS2cGA'}}
                defaultCenter={center}
                defaultZoom={zoom}
            >
                <OverlayMkad/>
            </GoogleMapReact>

        </div>
    );
}

Map.defaultProps = {
    center: {
        lat: 55.7522200,
        lng: 37.6155600,
    },

    zoom: 6,
}

export default Map;
